import React from 'react'
import './css/Domains.css'
import postsData from '../assets/domains.js'

function Domains() {
  const renderProductCards = () => {
    return postsData.slice(0, 5).map(post => (
            <li style={{fontWeight: 'bold', fontSize: '1.2em'}}>{post.title}</li>
    ));
  };
  return (
    <div className='App-domains'>
        <h1>Domains</h1>
        <ul className="guidelines-custom-list">
          {renderProductCards()}
        </ul>
    </div>
  )
}

export default Domains
